pragma solidity ^0.4.24;
contract Doc_translation {
    
    
   //meta data for original document
      struct document{
        
        string language;
        string ipfshash;
        string title;
        string author;
    }
    
    //metadata for each paragraphe in a document
    
     struct paragraphe{
        
        string ipfshash;
        uint sequnce;
    }
    
    
    //metadata for given translation for each paragraphe
    struct translatation{
        string language;
        string ipfshash;
        string title    ;
        string translator;
    }
    
    
    // this struct to hold an array of all paragraphes of a given docuement id  
    struct document_struct{
        uint256[] paragrapheIds;
    }
    
     // this struct to hold an array of all translations of a given paragraphe id  
     struct paragraphe_struct{
        uint256[] translateIds;
    }
    
   
    
    
    address private _owner; // the owner of the smart contract
        
    
    // event emitted when document creation completed sussuffly
    event CreateDocument(address indexed _from,string _language,string _ipfs, string _title, string _author,uint256 indexed _doc_id);
    
    // Here is mapping section 
    
    mapping (uint256 => address) private _ownerof; // mapping to store the owner of the docuement 
    mapping (uint256 =>document) private _documentID; // this mapping to link a document to unique id and store it
    mapping(uint256 => paragraphe) private _pragrapheID;// this mapping to link a paragraphe to unique id and store it
    mapping(uint256 => translatation) private _translationID;// this mapping to link a translatation to unique id and store it
    mapping(uint256 => document_struct) private _documentPragraphes;// this maaping to link documentid to an array of all its paragraphes id
    mapping(uint256 => paragraphe_struct) private _pragrapheTranslations;// this maaping to link paragraphe id to an array of all its translations id
    
// array to list all document ids created
    uint256[] private _DocIdArry;

   
  
     constructor() public{
        
        _owner=msg.sender;
    }
    
    function createDocument(uint256 _doc_id, string memory _language,string memory _ipfs ,string  memory _title,string memory  _author) public {
        
       require(_ownerof[_doc_id]==address(0),"exist id");
        
        document memory newDocument = document(_language,_ipfs,_title,_author);
        
        _ownerof[_doc_id]=msg.sender;
        
       
        
        _documentID[_doc_id]=newDocument;
        _DocIdArry.push(_doc_id);
        emit CreateDocument(msg.sender,_language,_ipfs,_title,_author,_doc_id);
        
        
        
        
    }
    
    
    
     function createPragraphe(uint256 _parg_id,uint256 _doc_id,uint256 _sequnce,string  memory _ipfs) public {
        
       require(_ownerof[_doc_id]!=address(0),"not exist id");
        
        paragraphe memory newParagraphe = paragraphe(_ipfs,_sequnce+1);
        
       // _ownerof[_doc_id]=msg.sender;
        
        
        _pragrapheID[_parg_id]=newParagraphe;
        
        _documentPragraphes[_doc_id].paragrapheIds.push(_parg_id);
        
        
        
        
        
        //emit CreateDoc(msg.sender,_language,_ipfs,_doc_id);
        
        
      
        
    }
    
    
     function createTranslatation(uint256 _tran_id,uint256 _parg_id,string memory  _language,string memory  _ipfs,string memory  _title,string memory  _translator) public {
        
       require(_pragrapheID[_parg_id].sequnce!=0,"exist id");
        
        translatation memory newTranslatation = translatation(_language,_ipfs,_title,_translator);
        
       // _ownerof[_doc_id]=msg.sender;
        
       
        
        _translationID[_tran_id]=newTranslatation;
        
        //_docIDtotranID[_doc_id].translateIds.push(_tran_id);
        
        _pragrapheTranslations[_parg_id].translateIds.push(_tran_id);
        
        //emit CreateDoc(msg.sender,_language,_ipfs,_doc_id);
        
    }
    
    
    
    function ListDocuments() public view returns(uint256[] memory ){

        return _DocIdArry;
    }
    
    
    
    function getDocument(uint256 _doc_id) public  view returns (string memory ,string memory ,string memory ,string memory ){
        
       document memory Document ;
       
       Document=_documentID[_doc_id];
       return (Document.language,Document.ipfshash,Document.title,Document.author);
    }
    
    function getTranslation(uint256 _tran_id) public view returns (string memory ,string memory ,string memory ,string memory ){
        
        
        
         translatation memory  Translatation ;
         
         
        Translatation = _translationID[_tran_id];
        
       // _ownerof[_doc_id]=msg.sender;
        
       
       
       return (Translatation.language,Translatation.ipfshash,Translatation.title, Translatation.translator);
    }
    
    
    function getDocumentParagraphes(uint256 _doc_id) public view returns (uint256[]  memory ){
        
       
       
       
        return _documentPragraphes[_doc_id].paragrapheIds;
    }
    
    
    
    function getParagrapheTranslatations(uint256 _parg_id) public view returns (uint256[]  memory ){
        
       
       
       
       return _pragrapheTranslations[_parg_id].translateIds;
    }
    
    
   
    


}
